import React from "react";
import "./App.css";
import UserList from "./components/UserList"; // Make sure this path is correct
import ErrorBoundary from "./components/ErrorBoundary"; // Adjusted path for ErrorBoundary

const App = () => {
  return (
    <div className="App">
      <h1>User Management Application</h1>
      <ErrorBoundary>
        <UserList />
      </ErrorBoundary>
    </div>
  );
};

export default App;
